import styled from "styled-components";

export const SkillWrapper = styled.div`
	.skillset {
		margin-top: 100px;
	}

	.skill-lockup {
		max-width: 450px;
		width: 100%;
		float: left;
		margin-right: 40px;
	}

	.skill-info {
		display: block;
		margin-bottom: 20px;
	}

	.skill-name {
		float: left;
		color: #666;
	}

	.skill-status {
		float: right;
		color: #c4c4c4;
		font-size: 0.8em;
	}
	.skill-bar {
		display: block;
		max-width: 450px;
		width: 100%;
		height: 10px;
		background: #e3e3e5;
		clear: both;
		margin: 20px 0;
	}

	.skill-level {
		display: table;
		height: 10px;
		background: red;
	}
	.skill-percentage {
		width: ${props => props.percentage};
		-webkit-animation: communication 1s linear;
		animation: communication 1s linear;
	}
	@keyframes communication {
		from {
			width: 0%;
		}
		to {
			width: ${props => props.percentage};
		}
	}
`;
